import React from 'react';
import './index.css';
import App from './App';

// Import createRoot from react-dom/client
import { createRoot } from 'react-dom/client';

// Replace ReactDOM.render with createRoot
const root = createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
